import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Set a mobile viewport
    await page.setViewportSize({ width: 375, height: 667 });

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_mobile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_mobile_view.png'));

    // Open the mobile menu by clicking the "All" button
    const menuButton = page.locator('div.nav-menu:has-text("All")');
    await menuButton.waitFor({ state: 'visible', timeout: 5000 });
    await menuButton.click();

    // Wait for the mobile menu overlay to be visible
    const menuOverlay = page.locator('#mobileMenuOverlay');
    await menuOverlay.waitFor({ state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // Click on the "Electronics" link within the mobile menu
    const electronicsLink = menuOverlay.getByRole('link', { name: 'Electronics' }).first();
    await electronicsLink.click();

    // Wait for the content to update and verify the heading
    const categoryHeading = page.getByRole('heading', { name: 'Electronics' });
    await categoryHeading.waitFor({ state: 'visible', timeout: 5000 });
    const extractedHeading = await categoryHeading.textContent();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_navigated_to_electronics.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_navigated_to_electronics.png'));

    // Close the mobile menu
    const closeButton = menuOverlay.locator('button.close-mobile-menu');
    await closeButton.waitFor({ state: 'visible', timeout: 5000 });
    await closeButton.click();

    // Verify the menu is closed by waiting for it to be hidden
    await menuOverlay.waitFor({ state: 'hidden', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_mobile_menu_closed.png'));

    return {
      success: true,
      action: "Successfully opened, navigated, and closed the mobile menu.",
      extractedData: {
        navigatedCategory: extractedHeading
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));
    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
